import React from 'react';
import { useParams } from 'react-router-dom';
import { useSelector } from 'react-redux';
import CardComponentShop from '../smallComponent/CardComponentShop';
import {
    Box,
    Card,
    CardActions,
    Link,
    CardContent,
    CardMedia,
    Button,
    Typography,
  } from "@mui/material";

const Dish = () => {
    const url=  useParams().slug;
    const allData = useSelector(state=>state)
    let data = []
    Object.keys(allData).map((key, index) =>{
        if(key==url)
            data = Object.entries(allData[key]);
    });
    const data1 = data[1][1]

    return (
        <Box>
            {/* {data.map((e)=>(
                <CardComponentShop data={data.url} /> 
            )} */}
            {
                data1.map(e=>(
                    <CardComponentShop />
                ))
            }
        </Box>
    );
}

export default Dish;
